# Kuybyshevo, Republic of Dagestan

}}
Kuybyshevo () is a rural locality (a selo) in Kalinovsky Selsoviet, Tarumovsky District, Republic of Dagestan, Russia. Population:
Geography
Kuybyshevo is located 24&nbsp;km southwest of Tarumovka (the district's administrative centre) by road. Tarumovka is the nearest rural locality.
